import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import ButtonAppBar from './components/navBar';

ReactDOM.render(
  <React.StrictMode>
    <ButtonAppBar/>
    <App />
    
  </React.StrictMode>,
  document.getElementById('root')
);
